import React from 'react'
import { ExpenseItem } from './ExpenseItem'

export const Expenses = (props) => {
    return (
        <div>
            <ExpenseItem title={props.items[0].title} amount={props.expenses[0].amount} date={props.expenses[0].date}></ExpenseItem>
            <ExpenseItem title={props.items[1].title} amount={props.expenses[1].amount} date={props.expenses[1].date}></ExpenseItem>
            <ExpenseItem title={props.items[2].title} amount={props.expenses[2].amount} date={props.expenses[2].date}></ExpenseItem>
            <ExpenseItem title={props.items[3].title} amount={props.expenses[3].amount} date={props.expenses[3].date}></ExpenseItem>
        </div>
    )
}
